import React from "react";
import styled from "styled-components";

/* Styled-Components */
const Container = styled.div``;

const Wrap = styled.div``;

const Category = () => {
  return (
    <Container>
      <Wrap></Wrap>
    </Container>
  );
};

export default Category;
